- input: "TEXT\x1CC00305920\x1CTEXT1\x1C\x1CF3A\x1CReference: April Quarterly Report
    (1/17/08-3/31/08) Dear Ms. Hough: This is being sent in response to your letter
    dated May 6, 2008.  The contributions received after the primary election that
    were designated for the primary, have now been redesignated for the general election.
    The 48-hour notices were filed on time and the contributors are, in fact, in Schedule
    A but are listed under the PAC names in our report.  These names are the PAC Managers
    that appear in our database with the PAC name on line 2 of the those names shown.
    \ Therefore when filing the notice the software vendor stated that the system
    was not configured correctly and that is why the name of the PAC did not show
    in the report. The software has now been corrected by our vendor. Those PAC contributors
    you have listed as missing 48-hour notices were in our database under the PAC
    Manager name as well, this is why the contributions appear to be missing.  I have
    since changed those records to reflect the PAC name on the first line of the record
    so that this does not occur again. You will receive the documentation for all
    referenced items above in the mail. The amended report should reflect ALL contributors
    so that the contributions are clearly indicated. Sincerely Terri Harris, Treasurer"
